import React from 'react';

function Team({ team }) {
    return (
        <div style={{ border: '1px solid #ddd', padding: '10px', marginBottom: '10px', display: 'flex', alignItems: 'center', justifyContent: 'space-between' }}>
            <img src={process.env.PUBLIC_URL + '/Images/' + team.avatarUrl || process.env.PUBLIC_URL + '/Images/default-avatar.png'} alt={team.name} style={{ width: '50px', height: '50px', marginRight: '10px' }} />
            <div>
                <h3>{team.name} (Rank: {team.rank})</h3>
                <p>Score: {team.score}</p>
                <p>Games Played: {team.gamesPlayed}</p>
                {team.achievements.length > 0 && (
                    <p>Achievements: {team.achievements.join(', ')}</p>
                )}
            </div>
        </div>
    );
}

export default Team;
